import React from "react";
import ReactDOM from "react-dom";
import Heading from "./Heading";
import Par from "./Par";
import Order from "./Order";

function App() {
  return (
    <>
      <Heading />
      <Par />
      <Order />
    </>
  );
}

export default App;
